import React from 'react'

export const UsersList = ({ usersData }) => {
    return (
        <div>
            {usersData.map(el => (
                <div key={el.id}>
                    <p>{el.firstName}</p>
                    <p>{el.lastName}</p>
                    <p>{el.dob}</p>
                </div>
                ))
            }
        </div>
    )
}
